SELECT
    UIDVALIDADOR AS UIDVALIDADOR,
--     TRUNC(DTFECHAOPERACION) AS FECHA,
--     smo.SESTATUS,
--      INUMEROTARJETA numTarjeta,
--     SDN.SPANHASH panash,
--     nfc.STIPOTARIFA,
    count(1)
FROM SINCRONIZADOR.DETALLESINCRONIZACIONTRANSACCIONESNFC nfc
join MONEDEROCONSULTAS.ESTADODECUENTA SMO on nfc.INUMEROTARJETA = smo.INUMTARJETA
left join sincronizador.DENEGADOS SDN on nfc.PANHASH = sdn.SPANHASH
WHERE TRUNC(nfc.DTFECHAOPERACION) = TRUNC(SYSDATE - 6/24)
  AND nfc.IERROR = 3
  ANd smo.SESTATUS = 'ACTIVO'
 and nfc.STIPOTARIFA = 'Tarifa General'
group by UIDVALIDADOR
;


